import './App.css';

async function getWeather() {
  try {
    const response = await fetch("http://api.weatherapi.com/v1/current.json?key=<your_api_key>&q=London");
    const data = await response.json();
    console.log(data);
    // Use the data as needed
    // For example, display the temperature in an element with the ID "temp"
    document.getElementById("temp").innerHTML = `Temperature: ${data.current.temp_c}°C`;
  } catch (error) {
    console.error(error);
  }
}

